import TopNav from '../components/TopNav';
import Menu from '../components/Menu';


const Announcements: React.FC = () => {

    return (
        <IonPage>
            <IonHeader>
                <TopNav title="Announcements" route='/u/home' backarrow={ true } hamburger = { true }/>
